import React, { Component} from 'react';
import { useState } from 'react';
import TreeMenu from 'react-simple-tree-menu';
import 'react-simple-tree-menu/dist/main.css';
// or as an object
/*const treeData = {
  'болячка1': {               // key
    label: 'название болячки1',
    index: 0, // decide the rendering order on the same level
       // any other props you need, e.g. url
    nodes: {
      'симптом1 болячки1': {
        label: 'симптом1',
        index: 0,
        nodes: { 
        },
      },
      'симптом2 болячки1': {
        label: 'симптом2',
        index: 0,
        nodes: { 
        },
      },
    },
  },
  'болячка2 ': {
    label: 'название болячки2',
    index: 1,
  },
};*/

class Tree123 extends Component {
  render() {
    const [treeData,settreeData] = useState(null)
    return (
      <div>
      <TreeMenu data={treeData} />

      <treeViewMenu
        data={treeData}
        onClickItem={({ key, label, ...props }) => {
          this.navigate(props.url); // user defined prop
        }}
        debounceTime={125}>
          {({ search, items }) => (
              <>
                <input onChange={e => search(e.target.value)} placeholder="Type and search" />
                <listGroup>
                  {items.map(props => (
                    // You might need to wrap the third-party component to consume the props
                    // check the story as an example
                    // https://github.com/iannbing/react-simple-tree-menu/blob/master/stories/index.stories.js
                    <listItem {...props} />
                  ))}
                </listGroup>
              </>
          )}
      </treeViewMenu>
        
      </div>
    );
  }
}

export default Tree123;
